import ReactDOM from 'react-dom';
import './index.css';
import React, { Component } from 'react';
import Landing from './containers/Landing';
import Location from './containers/Location';

const viewEnum = {
  LANDING: '1',
}

class Index extends Component {


  constructor(props) {
    super(props);
    this.state = {
      indexView: window.sessionStorage.getItem('indexView') || viewEnum.LANDING,
    }
  }

  render() {

    let view = null;
    switch (this.state.indexView) {

      case viewEnum.LANDING:
        view = <Location />;
        break;
    }

    return (
      <div>
        {view}
      </div>
    );

  }
}


ReactDOM.render(
  <React.StrictMode>
    <Index />
  </React.StrictMode>,
  document.getElementById('root')
);
